import "./bargraph.scss"
import FiberManualRecordIcon from '@mui/icons-material/FiberManualRecord';

import { BarChart, Bar, Rectangle, XAxis, YAxis, CartesianGrid, Tooltip, Legend, ResponsiveContainer } from 'recharts'

const data = [
    {
      name: 'Mon',
      uv: 20,
      amt: 10,
    },
    {
      name: 'Tue',
      uv: 40,
      amt: 20,
    },
    {
      name: 'Wed',
      uv: 2000,
      amt: 30,
    },
    {
      name: 'Thu',
      uv: 2780,
      pv: 3908,
      amt: 40,
    },
    {
      name: 'Fri',
      uv: 1890,
      amt: 50,
    },
    {
      name: 'Sat',
      uv: 2390,
      amt: 60,
    },
    {
      name: 'Sun',
      uv: 3490,
      amt: 70,
    },
  ];

  const Bargraph = () => {
  return (
    <div className="bargraphcontainer">


        <BarChart
          width={500}
          height={300}
          data={data}
          margin={{
            top: 5,
            right: 30,
            left: 20,
            bottom: 5,
          }}
        >
          <CartesianGrid strokeDasharray="2 2" />
          <XAxis dataKey="name" />
          <YAxis />
          <Tooltip />
          <Legend />
          <Bar dataKey="uv" fill="purple" activeBar={<Rectangle fill="gold" stroke="purple" />} />
        </BarChart>

      </div>
  )
}

export default Bargraph
